package nestedLoops;

public class PracticePattern2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (char i='A'; i<='E'; i++)  //outerLoop 
		{
			for (char j='A'; j<='E'; j++)  //inner loop 
			{
				System.out.print(i);  // inner loop body 
			}                                          
			System.out.println(); // outer loop body
		}

	}


	}


